 Here is a simple JavaScript code to display Pascal's triangle in an HTML canvas:
```javascript
// Get reference to canvas and context
var canvas = document.getElementById('myCanvas');
var ctx = canvas.getContext('2d');

// Define width and height of canvas
var width = canvas.width;
var height = canvas.height;

// Display Pascal's triangle
var index = 0;
while (index <= height) {
  // Draw the top row of the triangle
  ctx.beginPath();
  ctx.moveTo(0, index);
  ctx.lineTo(width, index);
  ctx.lineWidth = 1;
  ctx.strokeStyle = 'black';
  ctx.stroke();

  // Draw the rest of the triangle
  for (var i = 1; i <= index; i++) {
    ctx.beginPath();
    ctx.moveTo(i, 0);
    ctx.lineTo(i, index);
    ctx.strokeStyle = 'black';
    ctx.stroke();
  }

  // Increment index
  index++;
}
```
Note: The Pascal's triangle will be displayed at the center of canvas. If you want to display it at a specific position within the canvas, you can modify the `x` and `y` coordinates of the context method calls. Also, you may want to adjust the `index` variable if you want to display a different size of the Pascal's triangle. You can use CSS (`border: 1px solid black`) to style the canvas and/or the text if you want. Enjoy!

